<p>As I looked in Robot.java, I noticed code was commented out in Autonomous init… could that be the reason the riolog was putting these errors? Or do those errors not make sense with what the riolog says?</p>
<p>I remember we had a gradle issue in the first week of build season, but it’s been gone I believe before we satrted messing around with pathplanner.</p>
<p>One thing I forgot to mention is that after we deploy the pathplanner code and it doesn’t work, the RoboRio ocassionally can’t deploy even the code we know works from prior tests. It’s almost like it crashes, making us have to reimage it to properly deploy.</p>","post_number":3,"post_type":1,"posts_count":14,"updated_at":"2024-03-06T03:03:56.628Z","reply_count":1,"reply_to_post_number":2,"quote_count":0,"incoming_link_count":1,"reads":116,"readers_count":115,"score":33.2,"yours":false,"topic_id":457487,"topic_slug":"pathplanner-code-not-working","display_username":"Belal Alchahrour","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":null,"reply_to_user":{"id":64811,"username":"Scarlett_4131","name":"Scarlett Saam","avatar_template":"/user_avatar/www.chiefdelphi.com/scarlett_4131/{size}/218378_2.png"},"bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":62796,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"post_url":"/t/pathplanner-code-not-working/457487/3","custom_user_title":null,"reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":true},{"id":3325401,"name":"Scarlett Saam","username":"Scarlett_4131","avatar_template":"/user_avatar/www.chiefdelphi.com/scarlett_4131/{size}/218378_2.png","created_at":"2024-03-06T05:01:57.533Z","cooked":"<p>Hmm, i’d check to see if you have conflicting merges on your code. I think that might have been part of the problem when we had a similar issue.</p>
