</code></pre>
<p>Is loading all of the autos in the project.  I suspect one of your paths has an issue.  Perhaps, a field isn’t filled out?</p>
<p>We load our paths explicitly…</p>
<pre><code class="lang-auto">m_autoChooser.setDefaultOption("Dont Move", new WaitCommand(1.0));
m_autoChooser.addOption("S2 C1 C2 C3", drivetrain.getAutoPath("S2 C1 C2 C3"));
m_autoChooser.addOption("S2 C2 C3 F3", drivetrain.getAutoPath("S2 C2 C3 F3"));
</code></pre>
<p>So, if one has an issue we find it.  I’m surprised the auto name that is failing isn’t in your stacktrace, but I couldn’t find it.  (It does say it can’t find null.path…)</p>
<p>Additionally, you need to move your named commands so they are registered before you load your paths.</p>
<p>Put…</p>
<pre><code class="lang-auto">    //Register the Named Commands in Path Planner
    NamedCommands.registerCommand("shoot", shoot);
    NamedCommands.registerCommand("intakeNote", intakeNote);
</code></pre>
<p>Before…</p>
<pre><code class="lang-auto">autoChooser = AutoBuilder.buildAutoChooser();
</code></pre>","post_number":5,"post_type":1,"posts_count":14,"updated_at":"2024-03-06T13:26:33.267Z","reply_count":1,"reply_to_post_number":null,"quote_count":0,"incoming_link_count":9,"reads":85,"readers_count":84,"score":82.0,"yours":false,"topic_id":457487,"topic_slug":"pathplanner-code-not-working","display_username":"","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","bookmarked":false,"actions_summary":[{"id":2,"count":1}],"moderator":false,"admin":false,"staff":false,"user_id":36169,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":"Software Mentor"},"post_url":"/t/pathplanner-code-not-working/457487/5","custom_user_title":"Software Mentor","reactions":[{"id":"heart","type":"emoji","count":1}],"current_user_reaction":null,"reaction_users_count":1,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":true,"topic_accepted_answer":true},{"id":3325590,"name":"Belal Alchahrour","username":"Belal_4641","avatar_template":"/letter_avatar_proxy/v4/letter/b/4af34b/{size}.png","created_at":"2024-03-06T14:39:05.396Z","cooked":"<p>Ok! I’ll work on finding that path that’s causing the issue. If we load our paths, does that cause the specific path that doesn’t work to show up in the riolog? Also, does it matter if we load our paths before or after “AutoBuilder.buildAutoChooser”?</p>","post_number":6,"post_type":1,"posts_count":14,"updated_at":"2024-03-06T14:39:05.396Z","reply_count":1,"reply_to_post_number":5,"quote_count":0,"incoming_link_count":0,"reads":74,"readers_count":73,"score":19.8,"yours":false,"topic_id":457487,"topic_slug":"pathplanner-code-not-working","dis